import React, { useState, useContext } from 'react';
import axios from 'axios';
import './VirtualTry.css';
import { ShopContext } from '../../Context/ShopContext';
import { useParams } from 'react-router-dom';

const VirtualTry = () => {
  const { productId } = useParams(); 
  const [personImage, setPersonImage] = useState(null);
  const [clothImage, setClothImage] = useState(null);
  const [resultImage, setResultImage] = useState(null);
  const [isLoading, setIsLoading] = useState(false);
  const [errorMessage, setErrorMessage] = useState('');
  const { addToCart, all_product } = useContext(ShopContext);

  const product = all_product.find(p => p.id === Number(productId));

  // Handle person image upload
  const handlePersonImageUpload = (event) => {
    setPersonImage(event.target.files[0]);
  };

  // Handle cloth image upload
  const handleClothImageUpload = (event) => {
    setClothImage(event.target.files[0]);
  };

  // Add product to cart
  const handleAddToCart = () => {
    if (product) {
      addToCart(product.id);
      alert('Product added to cart!');
    }
  };

  const handleDownloadImage = () => {
    if (product?.image) {
      const link = document.createElement('a');
      link.href = product.image;
      link.download = `${product.name}.jpg`; // Set the file name
      link.click();
    }
  };

  // Handle virtual try-on process
  const handleTryOn = async () => {
    if (!personImage || !clothImage) {
      setErrorMessage('Please upload both images.');
      return;
    }

    const formData = new FormData();
    formData.append('personImage', personImage);
    formData.append('clothImage', clothImage);

    try {
      setIsLoading(true);
      const response = await axios.post(
        'http://localhost:4000/process-vitons',
        formData,
        {
          headers: { 'Content-Type': 'multipart/form-data' },
        }
      );

      if (response.data && response.data.result) {
        setResultImage(`http://localhost:4000${response.data.result}`);
        setErrorMessage('');
      } else {
        setErrorMessage('Something went wrong! Please try again.');
      }
    } catch (error) {
      console.error(error);
      setErrorMessage('Failed to process the try-on request.');
    } finally {
      setIsLoading(false);
    }
  };

  return (
    <div className="virtual-try-page">
      <div className="virtual-try-container">
        <h1 className="virtual-try-title">Virtual Try-On Experience</h1>
        <p className="virtual-try-description">Upload two images to try on products virtually!</p>

        {product && (
          <div>
            <h2>{product.name}</h2>
            <img src={product.image} alt={product.name} className="preview-image" />
            <button onClick={handleDownloadImage} className="button download-button">
              Download Product Image
            </button>
          </div>
        )}

        <div className="image-upload-section">
          <div>
            <label htmlFor="person-upload" className="button upload-image-button">
              Upload Person Image
            </label>
            <input
              id="person-upload"
              type="file"
              accept="image/*"
              onChange={handlePersonImageUpload}
              className="file-input"
              style={{ display: 'none' }}
            />
          </div>

          <div>
            <label htmlFor="cloth-upload" className="button upload-image-button">
              Upload Cloth Image
            </label>
            <input
              id="cloth-upload"
              type="file"
              accept="image/*"
              onChange={handleClothImageUpload}
              className="file-input"
              style={{ display: 'none' }}
            />
          </div>
        </div>

        {resultImage && (
          <div className="image-rendered">
            <h3 className="rendered-title">Virtual Try-On Result</h3>
            <img src={resultImage} alt="Rendered" className="rendered-image" />
          </div>
        )}

        <div className="button-section">
          <button onClick={handleTryOn} className="button try-on-button">
            {isLoading ? 'Processing...' : 'Try On'}
          </button>
          <button onClick={handleAddToCart} className="button add-to-cart-button">
            Add to Cart
          </button>
        </div>

        {errorMessage && <p className="error-message">{errorMessage}</p>}
      </div>
    </div>
  );
};

export default VirtualTry;
